// import { Fragment } from 'react';
// import styled,{css} from "styled-components";
// import './App.css';

const Header = ({title})=>{
  return(
    <header>
      <h1>
        <a href="#">
          {title}
        </a>
      </h1>
    </header>
  );
}

const Article = ({title, body}) =>{
  <article>
    <h3>{title}</h3>
    <p>{body}</p>
  </article>
}

const App = () => {
  return(
    <>
     <Header title="WEB"/>
    </>
  )
};

export default App;
